import React from 'react';
import './List.scss';
import { ListSelection } from '../List-Selection/List-Selection';

interface ListProps {
    name: string,
    listItems: string[],
    itemSelected: any
}

export class List extends React.Component<ListProps, {selection: string}> {
    render() {
        return (
            <div className="List">
                <h2>{this.props.name}</h2>
                {this.props.listItems.map((listItem: string, index: number) => {
                    return (
                        <div onClick={() => this.props.itemSelected(listItem)}>
                            <ListSelection
                                key={index}
                                name={listItem}
                                />
                        </div>

                    )
                })}
            </div>
        );
    }
};
